--checking the imported data and changing it to be accepted by postgis system
	--mainly : we have to map the SRID value into the max allowed by postgis, which is : 910 000 to 998 999

	--checking imported data
	SELECT * FROM spatial_ref_sys_temp;

	--Adding a temp column srid_temp to hold resuslt of processing
	ALTER TABLE spatial_ref_sys_temp ADD COLUMN srid_temp text;


	--Mapping to Postgis : 910 000 to 998 999.
		--Mapping for SRID of type 110 XXX

		--on affiche les srid qui commencent par 110 :
		SELECT srid
		FROM spatial_ref_sys_temp
		WHERE CAST(srid AS text) ILIKE '110%';

		--changing srid  to 911XXX where XXX are extracted.
		WITH new_srid AS (
			SELECT srid, '911' || SUBSTRING ( CAST(srid AS text) FROM '110(.*)000' ) AS new_srid_temp
			FROM spatial_ref_sys_temp
			WHERE CAST(srid AS text) ILIKE '110%'
		)
		UPDATE spatial_ref_sys_temp AS s_r_s_t 
		SET srid_temp = new_srid_temp 
		FROM new_srid 
		WHERE s_r_s_t.srid = new_srid.srid;


		--Checking the result
		SELECT * FROM spatial_ref_sys_temp
		WHERE CAST(srid AS text) ILIKE '110%';

	

	--Dealing with SIRD of type 210XXX000.

		--computing new srid
		WITH new_srid AS (
			SELECT srid, '921' || SUBSTRING ( CAST(srid AS text) FROM '210(.*)000' ) AS new_srid_temp
			FROM spatial_ref_sys_temp
			WHERE CAST(srid AS text) ILIKE '210%'
		)
		UPDATE spatial_ref_sys_temp AS s_r_s_t SET srid_temp = new_srid_temp FROM new_srid WHERE s_r_s_t.srid = new_srid.srid;




	--Dealing with srid of type 220XXX000
		
		--computing new srid
		WITH new_srid AS (
			SELECT srid, '922' || SUBSTRING ( CAST(srid AS text) FROM '220(.*)000' ) AS new_srid_temp
			FROM spatial_ref_sys_temp
			WHERE CAST(srid AS text) ILIKE '220%'
		)
		UPDATE spatial_ref_sys_temp AS s_r_s_t SET srid_temp = new_srid_temp FROM new_srid WHERE s_r_s_t.srid = new_srid.srid;



	--Dealing with srid of type 310 XXXX




		--updating srid_temp with 931XXX where XXX are simply the number
		WITH new_srid AS (
			SELECT  srid, CAST( 931000+ row_number() OVER(ORDER BY srid ASC ) AS text ) AS new_srid_temp
			FROM spatial_ref_sys_temp AS s_r_s_t
			WHERE CAST(srid AS text) ILIKE '31%'
			ORDER BY srid ASC
		)
		UPDATE spatial_ref_sys_temp AS s_r_s_t SET srid_temp = new_srid_temp FROM new_srid WHERE s_r_s_t.srid = new_srid.srid;


	--Dealing with srid of type 932XXXXXX
		WITH new_srid AS (
			SELECT  srid, CAST( 932000+ row_number() OVER(ORDER BY srid ASC ) AS text ) AS new_srid_temp
			FROM spatial_ref_sys_temp AS s_r_s_t
			WHERE CAST(srid AS text) ILIKE '32%'
			ORDER BY srid ASC
		)
		UPDATE spatial_ref_sys_temp AS s_r_s_t SET srid_temp = new_srid_temp FROM new_srid WHERE s_r_s_t.srid = new_srid.srid;


--Checking result : no duplicates, every srid between 910000 and 998 999, no null value
	SELECT srid_temp
	FROM spatial_ref_sys_temp
	GROUP BY srid_temp;

	SELECT *
	FROM spatial_ref_sys_temp
	WHERE srid_temp ISNULL
	OR CAST(srid_temp AS bigint) <910000 OR CAST(srid_temp AS bigint) > 998999;

--Updating column srid with column srid_temp
	UPDATE spatial_ref_sys_temp AS s_r_s_t_1 
		SET srid = CAST(s_r_s_t_2.srid_temp AS bigint) 
		FROM spatial_ref_sys_temp AS s_r_s_t_2 
		WHERE s_r_s_t_1.srid = s_r_s_t_2.srid;

--deleting column srid_temp
	ALTER TABLE spatial_ref_sys_temp DROP COLUMN srid_temp

--Inserting new spatial ref sys into postgis table from temp table
	
--Dropping the temp table
	DROP TABLE IF EXISTS spatial_ref_sys_temp;

